import React from 'react';
import Linechart1 from "./linechart1"
class Exposuretrends extends React.Component{
    constructor(){
        super()
    }

render(){
    return(
        <div className="et">
            <div className="et1">
            <p> Cyber Exposure Score</p>
            </div>
            <div className="et2">
                <Linechart1/>
            </div>
        <style jsx>
            {`
            .et{
                display:flex;
                flex-direction:column;
                
                height:100%;
                width:100%;
                background:pink;
                
            }
            .et1{
                display:flex;
                width:100%;
                height:16%;
                background:yellow;
                justify-content:flex-center;
                
            }
            .et2{
                overflow: hidden;
            }

            `}
        </style>
        
        </div>
    )
}
}
export default Exposuretrends;
